text:
@KRACare expects Kenyans to understand inflation as they increase the cost of 31 goods including motorcycles (boda bodas), bottled water and juice, beer and spirits, cigarettes and fuel from October 1.

You guys are just wicked. 

#Overtaxation

@Ma3Route To create demand, the ground floor road will have those boda boda, potholes, and lots of traffic jam. 

The express way on the other hand will be smooth, less congested, without boda bodas and muggers etc. 

Suddenly, it will be cheaper to pay 200 bob to use.
